using CovarianceEstimation, CSV, HiGHS, LinearAlgebra, OrderedCollections,
      PortfolioOptimiser, Statistics, StatsBase, Test, TimeSeries, Logging, Distances

import Distances: pairwise, UnionMetric

struct POCorDist <: Distances.UnionMetric end
function Distances.pairwise(::POCorDist, i, mtx)
    return sqrt.(clamp!((1 .- mtx) / 2, 0, 1))
end

struct APOCorDist <: Distances.UnionMetric end
function Distances.pairwise(::APOCorDist, i, mtx)
    return sqrt.(clamp!((1 .- mtx), 0, 1))
end

struct POCorDist2 <: Distances.UnionMetric end
function Distances.pairwise(::POCorDist2, i, mtx)
    return 2 * mtx
end

Logging.disable_logging(Logging.Warn)

prices = TimeArray(CSV.File("./assets/stock_prices.csv"); timestamp = :date)

rf = 1.0329^(1 / 252) - 1
l = 2.0

@testset "Custom Func and Val for Covariance" begin
    portfolio = Portfolio(; prices = prices)

    genfunc = GenericFunction(; func = x -> 3 * cov(x))
    estimation = CovEstOpt(; genfunc = genfunc)
    cov_opt = CovOpt(; method = :Custom_Func, estimation = estimation)

    asset_statistics!(portfolio; calc_kurt = false, cov_opt = cov_opt)
    cov1 = portfolio.cov

    cov_opt.method = :Custom_Val
    cov_opt.estimation.custom = 2 * cov(portfolio.returns)
    asset_statistics!(portfolio; calc_kurt = false, cov_opt = cov_opt)
    cov2 = portfolio.cov

    @test isapprox(cov1, 3 * cov(portfolio.returns))
    @test isapprox(cov2, 2 * cov(portfolio.returns))
end

