@testset "Correlation and Distance Matrix Estimation" begin
    portfolio = HCPortfolio(; prices = prices)

    cor_opt = CorOpt(; dist = DistOpt(; method = POCorDist()))
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor1 = portfolio.cor
    dist1 = portfolio.dist

    cor_opt.method = :Pearson
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor2 = portfolio.cor
    dist2 = portfolio.dist

    cor_opt.method = :Spearman
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor3 = portfolio.cor
    dist3 = portfolio.dist

    cor_opt.method = :Kendall
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor4 = portfolio.cor
    dist4 = portfolio.dist

    cor_opt.dist.method = APOCorDist()
    cor_opt.method = :Abs_Pearson
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor5 = portfolio.cor
    dist5 = portfolio.dist

    cor_opt.method = :Abs_Spearman
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor6 = portfolio.cor
    dist6 = portfolio.dist

    cor_opt.method = :Abs_Kendall
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor7 = portfolio.cor
    dist7 = portfolio.dist

    cor_opt.dist.method = POCorDist()
    cor_opt.method = :Gerber0
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor8 = portfolio.cor
    dist8 = portfolio.dist

    cor_opt.method = :Gerber1
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor9 = portfolio.cor
    dist9 = portfolio.dist

    cor_opt.method = :Gerber2
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor10 = portfolio.cor
    dist10 = portfolio.dist

    cor_opt.dist.method = Distances.Euclidean()
    cor_opt.method = :Distance
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor11 = portfolio.cor
    dist11 = portfolio.dist

    cor_opt.dist.method = POCorDist()
    cor_opt.method = :Mutual_Info
    cor12 = []
    cor13 = []
    cor14 = []
    dist12 = []
    dist13 = []
    dist14 = []
    try
        cor_opt.estimation.bins_info = :KN
        asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
        cor12 = portfolio.cor
        dist12 = portfolio.dist

        cor_opt.estimation.bins_info = :FD
        asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
        cor13 = portfolio.cor
        dist13 = portfolio.dist

        cor_opt.estimation.bins_info = :SC
        asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
        cor14 = portfolio.cor
        dist14 = portfolio.dist
    catch
