    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor16 = portfolio.cor
    dist16 = portfolio.dist

    cor_opt.estimation.bins_info = 10
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor17 = portfolio.cor
    dist17 = portfolio.dist

    cor_opt.method = :Tail
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
