    dist18 = portfolio.dist

    cor_opt.estimation.alpha = 0.2
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor19 = portfolio.cor
    dist19 = portfolio.dist

    cor_opt.method = :Cov_to_Cor
    cor_opt.dist.method = POCorDist2()
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor20 = portfolio.cor
    dist20 = portfolio.dist
    covar20 = portfolio.cov

    cor_opt.dist.method = POCorDist()
    cor_opt.method = :Custom_Func
    cor_opt.estimation.cor_genfunc.func = x -> -2 * cor(x)
    cor_opt.estimation.dist_genfunc.func = x -> 3 * x
    asset_statistics!(portfolio; calc_kurt = false, cor_opt = cor_opt)
    cor21 = portfolio.cor
    dist21 = portfolio.dist

    cor_opt.method = :Custom_Val
